      items: [
        {
          name: "Broccoli",
          number: 3,
          purchased: false,
        },
        {
          name: "Bananas",
          number: 6,
          purchased: false,
        }
      ]
    }
  }
  render() {
    return (
      <div>
        <h1 className="title">Grocery List</h1>

        <form></form>
        <div className="field has-addons">
          <div className="control"></div>
        </div>
      </div>
    );

  }

}

export default App;
